appLayout.description:
The Automation Analyzer provides analysis of automation run metadata across Qlik Cloud tenants, providing developers and administrators a holistic view of their Qlik Automate usage.

Available at https://github.com/qlik-oss/qlik-cloud-automation-analyzer

{v1.2.5}

